import styled from 'styled-components'
import Header from './componentes/Header'

const AppContainer = styled.div`
  *{
    margin: 0px;
    padding: 0px;
    cursor: default;
    box-sizing: border-box;
  }

  body{
    background-color: #0c0c0c;
    background-attachment: fixed;
}

  width: 100vw;
  height: 100vh;
`

function App() {
  return (
    <AppContainer>
     <Header></Header>
    </AppContainer>
  )
}

export default App
